
import { jsPDF } from "jspdf";

const poppinsFont = "";
const poppinsBoldFont = "";

jsPDF.API.events.push([
  "addFonts",
  function () {
    this.addFileToVFS("Poppins-Regular.ttf", poppinsFont);
    this.addFont("Poppins-Regular.ttf", "Poppins", "normal");

    this.addFileToVFS("Poppins-Bold.ttf", poppinsBoldFont);
    this.addFont("Poppins-Bold.ttf", "Poppins", "bold");
  }
]);
